  [],\n\t\"revision_timestamp\": \"2016-07-27T23:02:43.115526\",\n\t\"name\": \"observations-of-aleutian-canada-geese-on-little-kiska-i-in-1990\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Surveys were conducted in June and August
  at Little Kiska Island to look for Aleutian Canada geese (Branta Canadensis leucopareia)
  returning from previous translocations and to monitor the fate of birds released
  on the island in fall 1990. Two nesting pairs were found in June, the first known
  for over 60 years at Little Kiska. One nest produced 3 goslings and the other contained
  3 infertile eggs. In addition, 5 other adult geese (2 pairs, 1 single) were observed
  in spring. TweJ1ty-five geese were translocated from Buldir Island to Little Kiska
  I. on August 7, and subsequent observations indicated that there was high survival.
  No predation on geese by bald eagles (Haliaeetus leucocephalus) was noted in 1990
  in contrast to the situation in 1988 and 1989 when bald eagle predation was a major
  mortality factor. Factors possibly contributing to low predation rates include:
  the prevalence of dense fog, the presence of experienced geese (those nesting and
  summering at Little Kiska), the short period between release and flight capability,
  the presence of large numbers of young gulls (a buffer prey for eagles), and the
  relatively small numbers of geese.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
